import React from "react";


class Profile extends React.Component {
  render() {
    let imgSrc =  "http://localhost:3001/img/" + this.props.picture;
    return(
      <div id={this.props.name}>
      <img src= {imgSrc} />
      <h1>{this.props.name}</h1>
      <p>{this.props.bio}</p>
      </div>
    )
  }
}


export default Profile
